class DistinguishableSetDiv1 {
public:
	int count(vector <string> answer) {
	    map <int, int> seen;
	    int match[22] = {0};
	    int res = 1<<SZ(answer[0]);
		for(int i = 0; i < SZ(answer); i++)
        {
            for(int j = i+1; j < SZ(answer); j++)
            {
                int num = 0;
                for(int k = 0; k < SZ(answer[i]); k++)
                {
                    if(answer[i][k] == answer[j][k])
                        num |= 1 << k, match[k] = 1;
                }
                if(num && !seen[num])
                {
                    res -= 1<<no_of_ones(num);
                }
                seen[num] = 1;
            }
        }
        for(int i = 0; i < 5; i++)
            cout << match[i] << ",";
        cout << endl;
        return res;
	}
};


